    return (<div className="calendar-container">
        <h2>Calendar</h2>
        <p>djgmskgnsfpgj</p>
        <Calendar2
            localizer={localizer}
            events = {events}
            startAccessor="start"
            endAccessor="end"
        />
    </div>)
};

